package java_programs_te;

public class RelationalOpr8 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=10;
		int b=15;
		boolean c=a==b;
			System.out.println("a == b  :"+c);
			 c=a>b;
			
			System.out.println("a > b :"+c);
			 c=a<b;
			System.out.println("a < b :"+c);
			 c=a!=b;
			System.out.println("a != b :"+c);
			

	}

}
